import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

@Component({
  selector: 'app-metric-dashboard',
  standalone: true,
  imports: [CommonModule, FormsModule],
  template: `<div class="model-dashboard"><div class="dashboard-header"><h1>Metric Management</h1><button class="btn btn-primary">Add Metric</button></div><div class="placeholder"><p>Metric Dashboard - Coming Soon</p></div></div>`,
  styles: [`
    .model-dashboard { padding: 2rem; }
    .dashboard-header { display: flex; justify-content: space-between; align-items: center; margin-bottom: 2rem; }
    .placeholder { text-align: center; padding: 3rem; background: #f5f5f5; border-radius: 8px; }
  `]
})
export class MetricDashboardComponent implements OnInit {
  ngOnInit(): void {}
}
